// src/admin_wrapper/admin_service.js

// Get all flagged projects for admin
export async function get_flagged_projects() {
    try {
      const response = await fetch('/api/admin/flagged-projects', {
        method: 'GET',
        headers: { 'Content-Type': 'application/json' }
      });
  
      const text = await response.text(); // Read raw text for debugging
      try {
        const data = JSON.parse(text); // Try parsing as JSON
  
        if (!response.ok) {
          throw new Error(data.message || 'Failed to fetch flagged projects');
        }
  
        return data;
      } catch (jsonErr) {
        console.error('Expected JSON but got:', text);
        throw new Error('Server did not return valid JSON');
      }
  
    } catch (error) {
      console.error('Error fetching flagged projects:', error);
      throw error;
    }
  }
  
  // Delete (unflag) a flagged project by flag ID
  export async function delete_flag(flag_id) {
    try {
      const response = await fetch(`/api/admin/flagged-projects/${flag_id}`, {
        method: 'DELETE',
        headers: { 'Content-Type': 'application/json' }
      });
  
      const text = await response.text();
      try {
        const data = JSON.parse(text);
  
        if (!response.ok) {
          throw new Error(data.message || 'Failed to delete flag');
        }
  
        return data;
      } catch (jsonErr) {
        console.error('Expected JSON but got:', text);
        throw new Error('Server did not return valid JSON');
      }
  
    } catch (error) {
      console.error('Error deleting flag:', error);
      throw error;
    }
  }
